import { BrowserRouter, Route, Link, Switch } from "react-router-dom";
import Click from "./Clicker";
import Home from "./HomePage";
import Catalog from "./Catalog";
import {ProductPage} from "./ProductPage";
import {products_data} from "./ProductsDict";
import "./App.css"
import axios from "axios";
import {useEffect} from "react";

const BACKEND_URL = "http://127.0.0.1:8000";
const axiosInstance = axios.create({baseURL: BACKEND_URL})

function App() {
    useEffect(() => {
        axiosInstance.get('/product').then(res=> {console.log(res); console.log(res.data)}).catch(err=>console.log(err))
    }, []);

    return (
        <BrowserRouter basename="/" >
            <div>
                <ul>
                    <li>
                        <Link to="/">Старт</Link>
                    </li>
                    <li>
                        <Link to="/catalog">Каталог</Link>
                    </li>
                    <li>
                        <Link to="/click">Клик-клак</Link>
                    </li>
                </ul>
                <hr />
                <Switch>
                    <Route exact path="/">
                        <Home></Home>
                    </Route>
                    <Route path="/catalog">
                        <Catalog></Catalog>
                    </Route>
                    <Route path="/click">
                        <Click></Click>
                    </Route>
                    <Route path="/product/:id">
                        <ProductPage data={products_data}></ProductPage>
                    </Route>
                </Switch>
            </div>
        </BrowserRouter>
    );
}

export default App;
